<H1><A NAME="lnk4095"></A><SUP></SUP>Linker Tools Warning LNK4095</H1>

<P class=dt><B>filename is an NE format executable; use EXEHDR to dump it</B></P>

<P>The DUMPBIN program only works with COFF-format executable files. Use EXEHDR on NE format executables. EXEHDR is included with Visual C++ 1.5.</P>
